import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="p-8 max-w-3xl mx-auto text-center space-y-6">
      <h1 className="text-4xl font-bold">Fred Hyeonuk Nam</h1>
      <p className="text-lg text-gray-600">Researcher, Musician, Guitar Luthier</p>
<div className="mt-8 flex flex-col items-center gap-4">
  <Link to="/about" className="px-4 py-2 border rounded shadow-sm hover:bg-gray-100">About</Link>
  <Link to="/research" className="px-4 py-2 border rounded shadow-sm hover:bg-gray-100">Research</Link>
  <Link to="/music" className="px-4 py-2 border rounded shadow-sm hover:bg-gray-100">Music</Link>
  <Link to="/guitars" className="px-4 py-2 border rounded shadow-sm hover:bg-gray-100">Guitars</Link>
</div>
    </div>
  );
}
